import { getByDisplayValue } from "@testing-library/react";
import React from "react";

function ext() {
  return <div className="itemsub">Exterior(9)</div>;
}
function int() {
  return <div className="itemsub">Interior(10)</div>;
}
function Allphotos() {
  return (
    <div>
      <h1>
        Lorem Ipsum is simply dummy text of the printing and typesetting
        industry. Lorem Ipsum has been the industry's standard dummy text ever
        since the 1500s, when an unknown printer took a galley of type and
        scrambled it to make a type specimen book. It has survived not only five
        centuries, but also the leap into electronic typesetting, remaining
        essentially unchanged. It was popularised in the 1960s with the release
        of Letraset sheets containing Lorem Ipsum passages, and more recently
        with desktop publishing software like Aldus PageMaker including versions
        of Lorem Ipsum. Why do we use it? It is a long established fact that a
        reader will be distracted by the readable content of a page when looking
        at its layout. The point of using Lorem Ipsum is that it has a
        more-or-less normal distribution of letters, as opposed to using
        'Content here, content here', making it look like readable English. Many
        desktop publishing packages and web page editors now use Lorem Ipsum as
        their default model text, and a search for 'lorem ipsum' will uncover
        many web sites still in their infancy. Various versions have evolved
        over the years, sometimes by accident, sometimes on purpose (injected
        humour and the like). Where does it come from? Contrary to popular
        belief, Lorem Ipsum is not simply random text. It has roots in a piece
        of classical Latin literature from 45 BC, making it over 2000 years old.
        Richard McClintock, a Latin professor at Hampden-Sydney College in
        Virginia, looked up one of the more obscure Latin words, consectetur,
        from a Lorem Ipsum passage, and going through the cites of the word in
      </h1>
    </div>
  );
}
function all() {
  return (
    <a href={Allphotos()}>
      <div className="All">All Photos(36)</div>
    </a>
  );
}

function Card(props) {
  return (
    <div className={"cssbox item" + props.no}>
      {props.no == 2 ? ext() : ""}
      {props.no == 10 ? int() : ""}
      {props.no == 13 ? all() : ""}

      <a id={"image" + props.no} href={"#image" + props.no}>
        <img
          className={
            "cssbox_thumb " +
            (props.no === 1 ? "fimg " : "img ") +
            ((props.no > 5 && props.no < 10) || props.no > 13
              ? "hidden "
              : " ") +
            (props.no === 1 ? "fimg " : "img ")
          }
          src={props.address}
        />
        <span className="cssbox_full">
          <nav class="navbar navbar-expand-lg navbar-dark ">
            <a
              style={{ color: "grey" }}
              class="navbar-brand"
              href="javascript:alert('Hello');"
            >
              All Photos(36)
            </a>
            <div class="collapse navbar-collapse" id="navbarNav">
              <ul class="navbar-nav">
                <li class={"nav-item"}>
                  <a
                    class={
                      props.no > 0 && props.no < 10 ? " activ " : "nav-link "
                    }
                    href="#image1"
                  >
                    Exterior
                  </a>
                </li>
                <li class={"nav-item"}>
                  <a
                    class={
                      props.no > 9 && props.no < 20 ? " activ " : " nav-link"
                    }
                    href="#image10"
                  >
                    Interior
                  </a>
                </li>
                <li class={"nav-item"}>
                  <a
                    class={
                      props.no > 19 && props.no < 27 ? " activ " : "nav-link "
                    }
                    href="#image20"
                  >
                    Mechanical
                  </a>
                </li>
                <li class={"nav-item"}>
                  <a
                    class={
                      props.no > 26 && props.no < 33 ? " activ " : " nav-link"
                    }
                    href="#image32"
                  >
                    Docs
                  </a>
                </li>
                <li class={"nav-item"}>
                  <a
                    class={props.no > 32 ? " activ " : "nav-link "}
                    href="#image33"
                  >
                    Others
                  </a>
                </li>
              </ul>
            </div>
          </nav>
          <img className={"image" + props.no} src={props.address} />
        </span>
      </a>
      <a class="cssbox_close" href="#void"></a>
      <a class="cssbox_prev" href={"#image" + (+props.no - 1)}>
        &lt;
      </a>
      <a class="cssbox_next" href={"#image" + (+props.no + 1)}>
        &gt;
      </a>
    </div>
  );
}

export default Card;
